import React from 'react';
import './storyReel.css';
import Story from "./Story";

function StoryReel() {
    return (
        <div className="storyReel">
             <Story 
                 image = "https://c0.wallpaperflare.com/preview/536/971/826/rwanda-kigali-64waves-sunset.jpg"
                 profileSrc = "https://lh3.googleusercontent.com/a-/AOh14GglKmBwN7b62iLZ9jX1J8B8Gn4_xYRl55_pQBtd=s96-c-rg-br100"
                 title= "Pacis Stellan"
             />
        </div>
    )
}

export default StoryReel
